import React from 'react'
import { useState } from 'react'

const Header = () => {
    const [item, setItem] = useState([
      {
        id:1,
        checked:false,
        details: 'i am a boy'
      },
      {
        id:2,
        checked:false,
        details: 'i am a girl'
      },
      {
        id:3,
        checked:false,
        details: 'i am a boygirl'
      }
    ])
    setItem()
  return (
    <>
        <p>{item}</p>
    </>
  )
}

export default Header
